  ) {
    return (
      <nav className="navbar navbar-expand-lg custom-nav fixed-top sticky">
        <a className="navbar-brand" href="#home">Jae Kim</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <i className="fa fa-bars"></i>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item active">
              <a href="#about" className="active nav-link">
                <Link activeclassName="active"
                  to="home"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                > Home </Link>
              </a>
            </li>
            <li className="nav-item">
              <a href="#about" className="active nav-link">
                <Link activeclassName="active"
                  to="about"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                > About </Link>
              </a>
            </li>
            <li className="nav-item">
              <a href="#blog" className="nav-link"> <Link activeclassName="active"
                to="blog"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              > Blog </Link>
              </a>
            </li>
            <li className="nav-item">
              <a href="#work" className="nav-link"><Link activeclassName="active"
                to="work"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              > Projects </Link>
              </a>
            </li>
            <li className="nav-item">
              <a href="#contact" className="nav-link"><Link activeclassName="active"
                to="contact"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              > Contact </Link>
              </a>
            </li>
          </ul>
        </div>
      </nav>

    );
  }
}
export default MainHeader;
